SELECT AVG("movie_keyword"."keyword_id") as agg_0, COUNT(*) as agg_1 FROM "keyword" LEFT OUTER JOIN "movie_keyword" ON "keyword"."id" = "movie_keyword"."keyword_id"  WHERE "movie_keyword"."keyword_id" >= 929 AND "movie_keyword"."movie_id" <= 2031214 AND "keyword"."id" <= 125172;
SELECT COUNT(*) as agg_0 FROM "cast_info" LEFT OUTER JOIN "aka_name" ON "cast_info"."person_id" = "aka_name"."id"  WHERE "aka_name"."person_id" >= 4102498 AND "cast_info"."role_id" <= 2 AND "aka_name"."id" <= 619378;
SELECT COUNT(*) as agg_0, AVG("company_type"."id") as agg_1 FROM "company_type" LEFT OUTER JOIN "movie_companies" ON "company_type"."id" = "movie_companies"."company_type_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id"  WHERE "company_type"."id" != 3 AND "company_name"."country_code" != '%[fj]%';
SELECT "company_name"."country_code", COUNT(*) as agg_0 FROM "company_name" LEFT OUTER JOIN "movie_companies" ON "company_name"."id" = "movie_companies"."company_id"  WHERE "movie_companies"."movie_id" <= 1693323 AND "movie_companies"."id" <= 1455241 GROUP BY "company_name"."country_code" ORDER BY "company_name"."country_code";
SELECT COUNT(*) as agg_0, AVG("movie_companies"."company_type_id") as agg_1 FROM "company_type" LEFT OUTER JOIN "movie_companies" ON "company_type"."id" = "movie_companies"."company_type_id"  WHERE "company_type"."kind" != '%miscellaneous companies%' AND "movie_companies"."company_id" <= 5826 AND "movie_companies"."company_type_id" != 1;
SELECT "name"."gender", SUM("aka_name"."id") as agg_0, AVG("name"."id") as agg_1 FROM "aka_name" LEFT OUTER JOIN "name" ON "aka_name"."person_id" = "name"."id"  WHERE "aka_name"."id" <= 200283 AND "name"."id" >= 179052 AND "aka_name"."person_id" >= 1749761 AND "name"."surname_pcode" != '%O313%' GROUP BY "name"."gender" ORDER BY "name"."gender";
SELECT SUM("title"."id") as agg_0 FROM "char_name" LEFT OUTER JOIN "cast_info" ON "char_name"."id" = "cast_info"."person_role_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id"  WHERE "title"."episode_of_id" >= 679785.8197457035 AND "char_name"."id" <= 775725 AND "title"."id" <= 2438919;
SELECT SUM("person_info"."person_id") as agg_0, AVG("name"."id") as agg_1 FROM "person_info" LEFT OUTER JOIN "name" ON "person_info"."person_id" = "name"."id"  WHERE "person_info"."person_id" >= 748661 AND "person_info"."info_type_id" = 17;
SELECT SUM("movie_companies"."company_type_id") as agg_0 FROM "company_name" LEFT OUTER JOIN "movie_companies" ON "company_name"."id" = "movie_companies"."company_id" LEFT OUTER JOIN "title" ON "movie_companies"."movie_id" = "title"."id"  WHERE "movie_companies"."company_id" >= 64756 AND "company_name"."country_code" != '%[va]%' AND "company_name"."id" >= 7665 AND "movie_companies"."id" <= 1203630 AND "title"."id" IS NOT NULL;
SELECT "aka_name"."imdb_index", COUNT(*) as agg_0 FROM "person_info" LEFT OUTER JOIN "name" ON "person_info"."person_id" = "name"."id" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id"  WHERE "name"."surname_pcode" != '%K516%' AND "name"."id" >= 148800 AND "person_info"."info_type_id" = 20 AND "person_info"."person_id" <= 2057272 GROUP BY "aka_name"."imdb_index" ORDER BY "aka_name"."imdb_index";
